import React from "react";

const Blog = () => {
  return (
    <div className="p-8">
      <h1 className="text-3xl font-bold mb-4">Blog Page</h1>
      <p>Welcome to the blog page. More content coming soon!</p>
    </div>
  );
};

export default Blog;
